import React, { useReducer } from 'react';

import TotalDisplay from './components/TotalDisplay';
import CalcButton from './components/CalcButton';
import reducer, { initialState } from './reducers/index';
import { addOne, applyNumber } from './actions/index';
import { number } from 'yup';

function App() {
  const [state, dispatch] = useReducer(reducer, initialState);

  console.log(state);

  // const handleApplyNumber = (number) => {
  //   dispatch(applyNumber(number));
  // }
  const handleAddOne = () => {
    dispatch(addOne());
  }
  return (
    <div className="App">
      <nav className="navbar navbar-dark bg-dark">
        <span className="navbar-brand">Reducer Challenge</span>
      </nav>

      <div className="container row mt-5">
        <div className="col-md-12 d-flex justify-content-center">
          <form name="Cal">
            <TotalDisplay value={state.total} />
            <div className="row details">
              <span id="operation"><b>Operation:</b> {state.operation}</span>
              <span id="memory"><b>Memory:</b> {state.memory}</span>
            </div>

            <div className="row">
              <CalcButton value={"M+"} onClick={() => dispatch(addOne())} />
              <CalcButton value={"MR"} onClick={() => dispatch({ type: 'MEMORY_RECALL' })} />
              <CalcButton value={"MC"} onClick={() => dispatch({ type: 'MEMORY_CLEAR' })} />
            </div>

            <div className="row">
              <CalcButton value={1} onClick={handleAddOne} />
              <CalcButton value={2} onClick={() => dispatch(applyNumber(2))} />
              <CalcButton value={3} onClick={() => dispatch(applyNumber(3))} />
            </div>

            <div className="row">
              <CalcButton value={4} onClick={() => dispatch({ type: 'APPLY_NUMBER', payload: 4 })} />
              <CalcButton value={5} onClick={() => dispatch({ type: 'APPLY_NUMBER', payload: 5 })} />
              <CalcButton value={6} onClick={() => dispatch({ type: 'APPLY_NUMBER', payload: 6 })} />
            </div>

            <div className="row">
              <CalcButton value={7} onClick={() => dispatch({ type: 'APPLY_NUMBER', payload: 7 })} />
              <CalcButton value={8} onClick={() => dispatch({ type: 'APPLY_NUMBER', payload: 8 })} />
              <CalcButton value={9} onClick={() => dispatch({ type: 'APPLY_NUMBER', payload: 9 })} />
            </div>

            <div className="row">
              <CalcButton value={"+"} onClick={() => dispatch({ type: 'CHANGE_OPERATION', payload: '+' })} />
              <CalcButton value={"*"} onClick={() => dispatch({ type: 'CHANGE_OPERATION', payload: '*' })} />
              <CalcButton value={"-"} onClick={() => dispatch({ type: 'CHANGE_OPERATION', payload: '-' })} />
            </div>

            <div className="row ce_button">
              <CalcButton value={"CE"} onClick={() => dispatch({ type: 'CLEAR' })} />
            </div>
          </form>
        </div>
      </div>
    </div>
  );
}

export default App;
